function Profile() {
  return (
    <div className='flex justify-center items-center w-full h-screen'>
        <div className='shadow-lg shadow-grey-800 p-2'>
            <img width = "220" height = "220" src = 'https://images.unsplash.com/photo-1503023345310-bd7c1de61c7d?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxzZWFyY2h8Mnx8aHVtYW58ZW58MHx8MHx8&w=1000&q=80'/>


            <div>Name <span>Milan Kumar Gupta</span></div>
            <div>Email <span>milangupta95@gmail.com</span></div>
        </div>
    </div>
  )
}

export default Profile
